Salve,
sto creando un team, per fare tornei e giocare in compagnia.
Requisiti:
Almeno iron 4 per entrare (scherzo, almeno silver 4);
Essere simpatici;
Non tiltare troppo (ci penso io a quello);
Voler giocare in compagnia(sono solo come un cane);
Se siete interessati contattatemi tramite email: jleon7221@gmail.com .
Arrivederci e buon game
